var pcglib = {
	rotator : function (y_pre, y_next, y_container, y_item, n_duration, n_vertical, n_cicle, n_auto ) {
		this.mousclick = true;
		var myStep;
		var myVertical = n_vertical;
		var myCicle;
		var animate = false;
		var end = false;
		var iterator = 0;
		var cloneItemNum;
		var interval;
		if (this.mousclick){
			if (!n_cicle) {
				myStep = calculateSteps(y_item);
				y_pre.click(function(){!animate ? callRotatorProcess('+='):''; return false;});
				y_next.click(function(){!animate ? callRotatorProcess('-='):''; return false;});
			} else {
				myStep = calculateCicleSteps(y_item);
				if (n_auto) {
					interval = setInterval(function () {callCicleRotatorProcess(n_auto.to)}, n_auto.every);				
				};
				y_pre.click(function(){!animate ? callCicleRotatorProcess('+='):''; return false;});
				y_next.click(function(){!animate ? callCicleRotatorProcess('-='):''; return false;});
				$(y_container).hover(
					function () {
						n_auto ? clearInterval(interval) : '';
					},
					function () {
						if (n_auto) {
							interval = setInterval(function () {callCicleRotatorProcess(n_auto.to)}, n_auto.every);				
						};
					}
				);
				/*y_next.hover(
					function () {
						n_auto ? clearInterval(interval) : '';
					},
					function () {
						if (n_auto) {
							interval = setInterval(function () {callCicleRotatorProcess(n_auto.to)}, n_auto.every);				
						};
					}
				);*/
			};
		};
		this.changeIteratorAndInitRotate = function (to, i) {
			callRotatorProcess(to, i)
		};
		this.callCicleRotatorProcessBull = function (to, i) {
			cloneItemNum = i;
			callCicleRotatorProcess(to, true);
		};
		function calculateSteps (item) {
			var length = item.length;
			var stepArr = new Array();
			var needInvertStepArr = false;
			var stepWrapper = new Array();
			if (myVertical) {
				var itemSize = item.height();
				var windowSize = y_container.parent().height();
			} else {
				var itemSize = item.width();
				var windowSize = y_container.parent().width();				
			};
			var stepArrLength = Math.ceil((itemSize * length) / windowSize);
			var itemInStep = windowSize / itemSize;
			for (var i = 0; i < stepArrLength; i++) {
				var stepSize;
				if (length > itemInStep) {
					i == 0 ? stepSize = 0 : stepSize = stepArr[i-1] + itemInStep * itemSize;  
					length -= itemInStep;
				} else {
					stepSize = stepArr[i-1] + length * itemSize;
					needInvertStepArr = true;
				};
				stepArr.push(stepSize);
			};
			stepWrapper.push(stepArr);
			if (needInvertStepArr) {
				var invertStepArr = new Array();
				var maxStep = stepArr[stepArr.length-1];
				var currStep = maxStep;
				for (var i = stepArr.length; i > 0; i--){
					if (currStep > 0){
 						invertStepArr.unshift(currStep);
						currStep -= itemInStep * itemSize;
					} else {
						invertStepArr.unshift(0);
					};					
				};
			};
			stepWrapper.push(invertStepArr);
			y_container.data('iteratorLength', stepArr.length);
			return stepWrapper;
		};	
		function calculateCicleSteps (item) {
			var length = item.length;
			if (myVertical) {
				var itemSize = item.height();
				var windowSize = y_container.parent().height();
			} else {
				var itemSize = item.width();
				var windowSize = y_container.parent().width();				
			};
			var itemInStep = windowSize / itemSize;
			cloneItemNum = itemInStep;
			/////////
			y_container.data('iteratorLength', y_item.length);
			y_container.data('cloneItemNum', cloneItemNum);
			return cloneItemNum;
		};
		function callRotatorProcess(to, i) {
				if (myStep[1]){
					if (iterator == myStep[0].length-1){
						currStepArr = 1;
					} else if (iterator == 0){					
						currStepArr = 0;
					};
				} else {
					currStepArr = 0;	
				};
				to == '+=' && iterator != 0 ? iterator-- : '';
				to == '-=' && iterator != myStep[0].length-1 ? iterator++ : '';
				
			if (i || i == 0) iterator = i;
			switch (iterator) {
				case 0 : 
					y_container.data('iterator', iterator);
					y_container.trigger('firstSlide');
				break;
				case myStep[0].length-1 :
					y_container.data('iterator', iterator);
					y_container.trigger('lastSlide');
				break;
				default :
					y_container.data('iterator', iterator);
					y_container.trigger('slide');
				break;
			}
			if (iterator >= 0 && iterator <= myStep[0].length) {
				animate = true;
				if (iterator == '-=') {
					var nextStep = myStep[currStepArr][iterator];
				} else {
					var nextStep = -myStep[currStepArr][iterator];
				};
				if (myVertical) {
					$(y_container, $(this).parent()).animate({ top : nextStep }, n_duration,
					function () {
						animate = false;
					});
				} else {
					$(y_container, $(this).parent()).animate({ left : nextStep }, n_duration,
					function () {
						animate = false;
					});
				};
			};
			return false;
		};
		function callCicleRotatorProcess (to, noEvent) {
			if (myVertical) {
				var nextStep = cloneItemNum * y_item.height();
				if (to == '+=') {
					for (var i = 0; i < cloneItemNum; i++) {
						var myclass = y_item.attr('class');
						$( '.'+myclass+':last-child', y_container ).prependTo(y_container);
						$(y_container, $(this).parent()).css({top : -nextStep});
					};
				};
				if (!animate) {
					animate = true;
					$(y_container, $(this).parent()).animate({ top : to+nextStep }, n_duration,
					function () {
						for (var i = 0; i < cloneItemNum; i++) {
							var myclass = y_item.attr('class');
							if (to == '-=') {
								$( '.'+myclass+':first-child', y_container ).appendTo(y_container);
								$(y_container, $(this).parent()).css({top : 0});	
							}
						};
						animate = false;
					});
				};
			} else {
				if(!noEvent) cloneItemNum = y_container.data('cloneItemNum');
				var nextStep = cloneItemNum * y_item.width();
				if (to == '+=') {
					for (var i = 0; i < cloneItemNum; i++) {
						var myclass = y_item.attr('class');
						$( '.'+myclass+':last-child', y_container ).prependTo(y_container);
						$(y_container, $(this).parent()).css({left : -nextStep});
					};
				};
				if (!animate) {
				animate = true;
				if(!noEvent) y_container.trigger('slide', to);
				$(y_container, $(this).parent()).animate({ left : to+nextStep }, n_duration,
					function () {
						for (var i = 0; i < cloneItemNum; i++) {
							var myclass = y_item.attr('class');
							if (to == '-=') {
								
								$( '.'+myclass+':first-child', y_container ).appendTo(y_container);
								$(y_container, $(this).parent()).css({left : 0});
							}
						};
						animate = false;
					});
				};
			};
		};
	}
};



